import React from 'react'
import {useParams} from 'react-router-dom'

import './Nav.css'
import Video from './Miniature'

import './AdminVideo.css'



export const AdminVideoSelected = ({state}) => {
     
    let slug = useParams()

    const SelectedVideo=Object.keys(state.video)
                .map(items =>
                    {
                        let result=''
                        if(items==""+slug.slug){
                            console.log('ok')
                            result=
                                <Video key={items} 
                                    id={items}
                                    name={state.video[items].nom}
                                    url={state.video[items].url}
                                    tag={state.video[items].tag}
                                    vue={state.video[items].vue}
                                    like={state.video[items].like}
                                />
                        }
                        else{
                            result=''
                        }
                        return result
                })
   
    return (
        <div className='cards'>
           
           { SelectedVideo}
        </div>
    )
}


export default AdminVideoSelected
